Меня зовут Ольга Костина.
Я психолог, телесный терапевт, арт-терапевт. Помогаю людям выбраться из сложных ситуаций. Вижу то, что человек в стрессе не может заметить, знаю, как распутать клубок проблем.

Моя профессия меня вдохновляет и не даёт останавливаться. Постоянно повышаю свой профессиональный уровень. В профессии более 11 лет.

💫Методы работы:

✔️Процессуально-ориентированная терапия;

✔️Психодинамический;

✔️Системный подход в семейной коррекционной работе. Этапы:

- диагностический;
- ликвидация семейного конфликта;
- реконструктивный;
- поддерживающий.

✔️Эклектическое направление при работе с семьёй.
➡️Используются методы: групповой дискуссии, ролевые игры, домашние задания по модификации поведения, анализ и интерпретация взаимоотношений и т.д.

✔️Арт-терапия;

✔️Телесная терапия;

✔️Краниосакральная терапия.

📲Для записи пишите в личное сообщение.

🌟👍Вместе- всё решим!
#психолог_Костина
